-- Create the database
DROP DATABASE IF EXISTS gamestore;
CREATE DATABASE IF NOT EXISTS gamestore;

-- Switch to the created database
USE gamestore;

-- Create Clients Table
CREATE TABLE Clients (
    client_id INT AUTO_INCREMENT PRIMARY KEY,
    first_name VARCHAR(255),
    last_name VARCHAR(255),
    email VARCHAR(255) UNIQUE,
    phone_number VARCHAR(20),
    address VARCHAR(255)
);

-- Create Payment Information Table
CREATE TABLE PaymentInformation (
    payment_id INT AUTO_INCREMENT PRIMARY KEY,
    client_id INT,
    payment_method VARCHAR(50),
    card_number VARCHAR(20),
    expiration_date DATE,
    cvv VARCHAR(10),
    hash varchar(64),
    FOREIGN KEY (client_id) REFERENCES Clients(client_id)
);

-- Create Publishers Table
CREATE TABLE Publishers (
    publisher_id INT AUTO_INCREMENT PRIMARY KEY,
    publisher_name VARCHAR(255),
    country VARCHAR(100)
);

-- Create Genres Table
CREATE TABLE Genres (
    genre_id INT AUTO_INCREMENT PRIMARY KEY,
    genre_name VARCHAR(50)
);

-- Create Games Table
CREATE TABLE Games (
    game_id INT AUTO_INCREMENT PRIMARY KEY,
    title VARCHAR(255),
    genre_id INT,
    release_date DATE,
    price DECIMAL(10, 2),
    publisher_id INT,
    FOREIGN KEY (genre_id) REFERENCES Genres(genre_id),
    FOREIGN KEY (publisher_id) REFERENCES Publishers(publisher_id)
);

-- Create Game Statistics Table
CREATE TABLE GameStatistics (
    statistics_id INT AUTO_INCREMENT PRIMARY KEY,
    game_id INT,
    total_sales INT,
    average_rating DECIMAL(3, 2),
    playtime INT,
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);

-- Create Orders Table
CREATE TABLE Orders (
    order_id INT AUTO_INCREMENT PRIMARY KEY,
    client_id INT,
    order_date DATE,
    total_amount DECIMAL(10, 2),
    FOREIGN KEY (client_id) REFERENCES Clients(client_id)
);

-- Create Order Details Table
CREATE TABLE OrderDetails (
    order_detail_id INT AUTO_INCREMENT PRIMARY KEY,
    order_id INT,
    game_id INT,
    quantity INT,
    subtotal DECIMAL(10, 2),
    FOREIGN KEY (order_id) REFERENCES Orders(order_id),
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);

-- Additional Tables

-- Create Employees Table
CREATE TABLE Employees (
    employee_id INT AUTO_INCREMENT PRIMARY KEY,
    first_name VARCHAR(255),
    last_name VARCHAR(255),
    position VARCHAR(50),
    email VARCHAR(255) UNIQUE,
    phone_number VARCHAR(20)
);

-- Create Employee Sales Table
CREATE TABLE EmployeeSales (
    sales_id INT AUTO_INCREMENT PRIMARY KEY,
    employee_id INT,
    order_id INT,
    commission_amount DECIMAL(10, 2),
    FOREIGN KEY (employee_id) REFERENCES Employees(employee_id),
    FOREIGN KEY (order_id) REFERENCES Orders(order_id)
);

-- Create Discounts Table
CREATE TABLE Discounts (
    discount_id INT AUTO_INCREMENT PRIMARY KEY,
    game_id INT,
    discount_percentage DECIMAL(5, 2),
    start_date DATE,
    end_date DATE,
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);

-- Create Reviews Table
CREATE TABLE Reviews (
    review_id INT AUTO_INCREMENT PRIMARY KEY,
    client_id INT,
    game_id INT,
    rating DECIMAL(3, 2),
    review_date DATE,
    FOREIGN KEY (client_id) REFERENCES Clients(client_id),
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);



-- Create Platforms Table
CREATE TABLE Platforms (
    platform_id INT AUTO_INCREMENT PRIMARY KEY,
    platform_name VARCHAR(50)
);

-- Create Game Platforms Table
CREATE TABLE GamePlatforms (
    game_platform_id INT AUTO_INCREMENT PRIMARY KEY,
    game_id INT,
    platform_id INT,
    FOREIGN KEY (game_id) REFERENCES Games(game_id),
    FOREIGN KEY (platform_id) REFERENCES Platforms(platform_id)
);

-- Create Transactions Table
CREATE TABLE Transactions (
    transaction_id INT AUTO_INCREMENT PRIMARY KEY,
    order_id INT,
    transaction_date DATE,
    amount DECIMAL(10, 2),
    transaction_type VARCHAR(50),
    FOREIGN KEY (order_id) REFERENCES Orders(order_id)
);

-- Create Inventory Table
CREATE TABLE Inventory (
    inventory_id INT AUTO_INCREMENT PRIMARY KEY,
    game_id INT,
    quantity_available INT,
    last_restock_date DATE,
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);

-- Create Wishlists Table
CREATE TABLE Wishlists (
    wishlist_id INT AUTO_INCREMENT PRIMARY KEY,
    client_id INT,
    game_id INT,
    added_date DATE,
    FOREIGN KEY (client_id) REFERENCES Clients(client_id),
    FOREIGN KEY (game_id) REFERENCES Games(game_id)
);


















